import React, { useState } from 'react';

const HealthTips = ({ onNavigate }) => {
  const [currentTip, setCurrentTip] = useState(0);

  const healthyTips = [
    {
      title: "Stay Hydrated",
      tip: "Drink at least 8 glasses of water daily. Sometimes thirst is mistaken for hunger!",
      icon: "fas fa-tint",
      color: "#2196F3"
    },
    {
      title: "Portion Control",
      tip: "Use smaller plates to naturally reduce portion sizes. Your brain will think you're eating more!",
      icon: "fas fa-utensils",
      color: "#4CAF50"
    },
    {
      title: "Eat Slowly",
      tip: "Take 20 minutes to eat your meal. It takes time for your brain to register fullness.",
      icon: "fas fa-clock",
      color: "#FF9800"
    },
    {
      title: "Colorful Plates",
      tip: "Aim for 5 different colors on your plate. More colors = more nutrients!",
      icon: "fas fa-palette",
      color: "#E91E63"
    },
    {
      title: "Protein Power",
      tip: "Include protein in every meal to stay fuller longer and maintain muscle mass.",
      icon: "fas fa-dumbbell",
      color: "#9C27B0"
    },
    {
      title: "Mindful Eating",
      tip: "Eat without distractions. Focus on your food to better recognize hunger and fullness cues.",
      icon: "fas fa-brain",
      color: "#607D8B"
    }
  ];

  const nextTip = () => {
    setCurrentTip((prev) => (prev + 1) % healthyTips.length);
  };

  const prevTip = () => {
    setCurrentTip((prev) => (prev - 1 + healthyTips.length) % healthyTips.length);
  };

  const tip = healthyTips[currentTip];

  return (
    <div style={{ padding: '32px 0', minHeight: 'calc(100vh - 80px)' }}>
      <div className="container">
        <div style={{ maxWidth: '600px', margin: '0 auto', textAlign: 'center' }}>
          <h1 style={{ fontSize: '32px', fontWeight: '700', color: '#333', marginBottom: '16px' }}>
            Healthy Tips
          </h1>
          <p style={{ color: '#666', fontSize: '16px', marginBottom: '48px' }}>
            Daily tips to help you maintain a healthy lifestyle
          </p>

          <div className="card" style={{ marginBottom: '32px', padding: '48px 32px' }}>
            <div style={{ marginBottom: '24px' }}>
              <i 
                className={tip.icon} 
                style={{ 
                  fontSize: '48px', 
                  color: tip.color, 
                  marginBottom: '16px' 
                }}
              ></i>
            </div>

            <h2 style={{ 
              fontSize: '24px', 
              fontWeight: '600', 
              color: '#333', 
              marginBottom: '16px' 
            }}>
              {tip.title}
            </h2>

            <p style={{ 
              fontSize: '18px', 
              color: '#666', 
              lineHeight: '1.6',
              marginBottom: '32px'
            }}>
              {tip.tip}
            </p>

            <div style={{ 
              display: 'flex', 
              justifyContent: 'center', 
              gap: '16px',
              marginBottom: '24px'
            }}>
              <button 
                className="btn btn-outline"
                onClick={prevTip}
                style={{ padding: '8px 16px' }}
              >
                <i className="fas fa-chevron-left"></i>
              </button>
              <button 
                className="btn btn-outline"
                onClick={nextTip}
                style={{ padding: '8px 16px' }}
              >
                <i className="fas fa-chevron-right"></i>
              </button>
            </div>

            <div style={{ 
              display: 'flex', 
              justifyContent: 'center', 
              gap: '8px' 
            }}>
              {healthyTips.map((_, index) => (
                <div
                  key={index}
                  style={{
                    width: '8px',
                    height: '8px',
                    borderRadius: '50%',
                    background: index === currentTip ? '#4CAF50' : '#e0e0e0',
                    cursor: 'pointer'
                  }}
                  onClick={() => setCurrentTip(index)}
                />
              ))}
            </div>
          </div>

          <div style={{ 
            display: 'grid', 
            gridTemplateColumns: 'repeat(auto-fit, minmax(150px, 1fr))', 
            gap: '16px' 
          }}>
            <div style={{ 
              padding: '16px',
              background: '#f8f9fa',
              borderRadius: '8px',
              textAlign: 'center'
            }}>
              <i className="fas fa-apple-alt" style={{ fontSize: '24px', color: '#4CAF50', marginBottom: '8px' }}></i>
              <p style={{ fontSize: '12px', fontWeight: '600' }}>Eat Whole Foods</p>
            </div>
            <div style={{ 
              padding: '16px',
              background: '#f8f9fa',
              borderRadius: '8px',
              textAlign: 'center'
            }}>
              <i className="fas fa-walking" style={{ fontSize: '24px', color: '#FF9800', marginBottom: '8px' }}></i>
              <p style={{ fontSize: '12px', fontWeight: '600' }}>Stay Active</p>
            </div>
            <div style={{ 
              padding: '16px',
              background: '#f8f9fa',
              borderRadius: '8px',
              textAlign: 'center'
            }}>
              <i className="fas fa-bed" style={{ fontSize: '24px', color: '#2196F3', marginBottom: '8px' }}></i>
              <p style={{ fontSize: '12px', fontWeight: '600' }}>Get Rest</p>
            </div>
          </div>

          <div style={{ textAlign: 'center', marginTop: '32px' }}>
            <button 
              className="btn btn-primary"
              onClick={() => onNavigate('dashboard')}
              style={{ fontSize: '16px', padding: '12px 24px' }}
            >
              Back to Dashboard
            </button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default HealthTips;
